import Item from "./Item";
// import React, { Component } from 'react';

const users = [
  { id: 1, num: 1 },
  { id: 2, num: 2 },
];
// console.log(users);

function ListNote(props) {
     return (
       <ul>
         {users.map(note => 
           <Item key={note.id} note={note} />
         )}
         {/* {props.notes.map(note => 
        <Item key={note.id} note={note} />
      )} */}
       </ul>
     );
}
export default ListNote;
